INSERT INTO w_dishes VALUES (229, 'This drink is arguably the most famous hot cocktail of all timenot to mention our favorite remedy for a coldand its super simple to make. The original Hot Toddy (also called the Whisky Skin) doesnt call for any fancy ingredients, just a mix of boiling water, sugar, lemon and whiskey. Our recipe also calls for a few cloves and uses complex turbinado sugar, but it''s just as easy. And, best of all, it works with Scotch, Irish whiskey, bourbon and rye.', '', '', '5.00', 3, 13, 'HOT TODDY', true, 1, 0, 0, false, 0, NULL, 0, NULL, NULL, NULL, NULL, 0);;
INSERT INTO w_dishes VALUES (1350, 'An irresistible wine whose elegance draws you subliminally into its orbit. Intense ruby-garnet in color, it is redolent of a profusion of aromas of coffee, cherries and sun dried fruits. Its high alcohol makes it full and generous in the mouth and it overwhelms the palate with intense flavors, prolonging your pleasure with its characteristic slightly bitter finish.
