INSERT INTO w_dishes VALUES (1351, 'A wine that evokes legend and fascination with its brilliant garnet-red and flashes of amber. The bouquet is both pleasing and intense with aromatic notes of violets and oregano. Smooth in the mouth with crisp acidity, its firm but well integrated tannins give good length on the palate.  It is a wine that exudes glory, nobility and power.
INSERT INTO w_dishes VALUES (1428, 'This supple, fruity and delicate red wine is best consumed young. Cherries and plums fill the nose and the sweet cherry follows through the mouth where it lingers . This refreshing wine is best served slightly chilled. It suits desserts and is excellent as an aperitif.
INSERT INTO w_dishes VALUES (1430, 'A big, full-bodied wine that is excellent as a before or after dinner drink. This deeply colored wine of purples and reds is sweet and aromatic. Its delectable smoothness is due to a low acid content, delivering a rich earthy flavor, but it is mainly used to increase the intensity of color and body in other grape varieties.  
INSERT INTO w_dishes VALUES (1429, 'Yuengling, Killians, Brooklyn Lager)  More malt and darker than their lighter lager relatives, usually amber to copper colored. Flavor profiles vary considerably between breweries. Nine times out of ten when a beer label says no more than Lager it is an amber.', '', '["59"]', '6.00', 47, 275, 'XX Lager', true, 1, 0, 0, false, 0, NULL, 0, NULL, NULL, NULL, NULL, 0);;
INSERT INTO w_dishes VALUES (1432, 'Very similar to stout but made from, or largely from, unroasted barley. Sweet and dark brown in color with hints of chocolate and a sometimes-sharp bitterness.', '', '["59"]', '6.00', 47, 275, 'Heineken', true, 1, 0, 0, false, 0, NULL, 0, NULL, NULL, NULL, NULL, 0);;
INSERT INTO w_dishes VALUES (1433, 'Whether American or English, the pale was clipped on long ago to distinguish it from the dark color of Porters. American and English styles differ, but generally they are gold or copper colored and dry with crisp hop flavor.', '', '["59"]', '6.00', 47, 275, 'Stella artois', true, 1, 0, 0, false, 0, NULL, 0, NULL, NULL, NULL, NULL, 0);;
INSERT INTO w_dishes VALUES (1424, 'Weve tried many recipes for the delicious and classic Irish Coffee, but this one, from top mixologist Jack McGarry of famed New York bar The Dead Rabbit, is our favorite. The secret is a bit of Demerara sugar syrup and hand-whipped cream. Youre bound to love this recipe as much as we do!
INSERT INTO w_dishes VALUES (1425, 'Having a party? Whip up this spirited fall drink that features apple cider, pomegranate, cognac and a bit of rum. The best part? It can be served hot or cold.
