INSERT INTO w_dishes VALUES (1485, 'A wine that evokes legend and fascination with its brilliant garnet-red and flashes of amber. The bouquet is both pleasing and intense with aromatic notes of violets and oregano. Smooth in the mouth with crisp acidity, its firm but well integrated tannins give good length on the palate.  It is a wine that exudes glory, nobility and power.
