INSERT INTO w_lang_admin VALUES (640, 'BUSINESS_EMAIL_NOTIFICATION', true, NULL, 'These are the E-mail notifications sent to the businesses every time a customer places an order from the desktop version, mobile web version, iOS and Android App. Please configure the Email address of the business owner in order to activate this notifications.', 'Dies sind die E-Mail-Benachrichtigungen jedes Mal ein Kunde einen Auftrag von der Desktop-Version, mobile Web-Version, iOS und Android-App fr die Unternehmen geschickt. Konfigurieren Sie den E-Mail-Adresse der Unternehmer, um diese Benachrichtigungen zu aktivieren.', 'Estas son las notificaciones de correo electrnico enviados a las empresas cada vez que un cliente realiza un pedido de la versin de escritorio, la versin web mvil, iOS y Android App. Por favor, configure la direccin de correo electrnico del propietario de la empresa con el fin de activar esta notificaciones.', 0);;
