INSERT INTO w_lang_admin VALUES (655, '', true, NULL, 'VoguePay is a unique online payment processor whose vision is to offer buyers and sellers a secure and easy-to-use means of transacting business online. VoguePay allows site owners to recieve payment for their goods and services on their website without any setup fee.', 'VoguePay ist eine einzigartige Online-Payment-Prozessor, dessen Vision ist es, Kufer und Verkufer eine sichere und einfach zu bedienende Hilfe von Online-Abwicklung von Geschften bieten. VoguePay ermglicht Website-Betreiber, die Zahlung fr ihre Waren und Dienstleistungen auf ihrer Website ohne Einrichtungsgebhr erhalten.', 'VoguePay es un procesador de pagos en lnea nica cuya visin es ofrecer a los compradores y vendedores de un medio seguro y fcil de usar de realizar transacciones comerciales en lnea. VoguePay permite a los propietarios del sitio para recibir el pago por sus productos y servicios en su pgina web sin ningn tipo de cuota de instalacin.', 0);;
