INSERT INTO w_lang_admin VALUES (693, 'CONTROL_PANEL_APPS_LIVE_CHAT', true, NULL, 'Live chat software for business. Intelligent customer engagement, real-time website monitoring and live help/live support tools. Increase your sales and ROI.', 'Live-Chat-Software fr Unternehmen. Intelligent Customer Engagement, Echtzeit-berwachung von Internet-und Live-Hilfe / Live-Support-Tools. Steigern Sie Ihren Umsatz und ROI.', 'Software de chat en vivo para los negocios. Compromiso inteligente al cliente, control de sitios web en tiempo real y de ayuda / herramientas de soporte en vivo en directo. Aumente sus ventas y el ROI.', 0);;
INSERT INTO w_lang_admin VALUES (694, 'CONTROL_PANEL_APPS_OLARKLIVECHAT_DESCRIPTION', true, NULL, 'Oark is the most beautiful and effective way to talk to your customers for sales and support. And we make it super easy for you! Solve customer problems before they have a chance to click away.', 'Oark ist der schnste und effektivste Weg, um fr Ihre Kunden fr Vertrieb und Support zu sprechen. Und wir machen es Ihnen leicht, Super! Lsen von Kundenproblemen, bevor sie eine Chance, Klick entfernt haben.', 'Oark es la forma ms bella y eficaz para hablar con sus clientes por ventas y soporte. Y lo hacemos muy fcil para usted! Resolver problemas de los clientes antes de que tengan la oportunidad de clic de distancia.', 0);;
