INSERT INTO w_lang_admin VALUES (695, 'CONTROL_PANEL_APPS_CRAZY_EGG_DESCRIPTION', true, NULL, 'Crazy Egg is like a pair of x-ray glasses that lets you see exactly what people are doing on your website. Like, showing you where people are clicking and where they are not. Or how many people scroll down your pages (and where most people stop).', 'Verrcktes Egg ist wie ein Paar Rntgenbrille, die Sie genau sehen, was die Leute auf Ihrer Website tun knnen. Wie, zeigt Ihnen, wo die Menschen sind clicking  | und wo sie nicht sind. Oder wie viele Menschen Ihre Seiten (und wo die meisten Menschen zu stoppen) nach unten scrollen.', 'Loco huevo es como un par de gafas de rayos X que le permite ver exactamente lo que est haciendo la gente en su sitio web. Al igual, que le muestra donde la gente es clicking  | y donde no lo son. O cmo muchas personas se desplazan hacia abajo sus pginas (y donde dejar la mayora de la gente).', 0);;
INSERT INTO w_lang_admin VALUES (696, 'CONTROL_PANEL_APPS_MAILCHIMP_DESCRIPTION', true, NULL, 'Mailchimp steps: Create a free account on mailchimp https://goo.gl/HHVnCE , Find or generate api key http://goo.gl/W8sjHD , Create a list http://goo.gl/oJYqQK , Find your list id http://goo.gl/q3JVlZ , *Optional if you want you can configure more options on the emails sent to your subscribers, please check this http://goo.gl/tLfmxF', 'Mailchimp vor: Erstellen Sie ein kostenloses Konto auf MailChimp https://goo.gl/HHVnCE, finden oder zu erzeugen API-Schlssel http://goo.gl/W8sjHD, Erstellen Sie eine Liste http://goo.gl/oJYqQK, Suche Ihre Liste id http://goo.gl/q3JVlZ, * Optional, wenn Sie knnen Sie weitere Optionen auf die E-Mails an Ihre Abonnenten konfigurieren mchten, klicken Sie bitte auf diese http://goo.gl/tLfmxF', 'MailChimp pasos: Crear una cuenta gratuita en MailChimp https://goo.gl/HHVnCE, Buscar o generar api http://goo.gl/W8sjHD clave, Crear una lista http://goo.gl/oJYqQK, Encuentra tu lista Identificacin del http://goo.gl/q3JVlZ, * Opcional si lo deseas, puedes configurar ms opciones en los correos electrnicos enviados a sus suscriptores, por favor revise esta http://goo.gl/tLfmxF', 0);;
