INSERT INTO w_lang_admin VALUES (1598, 'BUSINESS_CARD_DELIVERY', true, NULL, 'This payment method is almost as cash, there are some businesses that have mobile credit card terminals, those can either be like bank mobile terminal or smartphone credit card processors like Square. Basically the user places and order and pays with his credit card on his address when receiving the order.', 'Diese Zahlungsmethode ist fast wie Bargeld, gibt es einige Unternehmen, die mobilen Kreditkarten-Terminals haben, knnen diejenigen, entweder wie Bank mobilen Endgert oder Smartphone Kreditkarten-Prozessoren wie Square. Grundstzlich sind die Benutzer Orte und Ordnung und zahlt mit seiner Kreditkarte auf seinem Adresse, wenn Eingang der Bestellung.', 'Esta forma de pago es casi tan efectivo, hay algunas empresas que tienen terminales de la tarjeta de crdito mviles, ya sea los que pueden ser como los procesadores bancarios mviles terminales o telfonos inteligentes de tarjetas de crdito, como la plaza. Bsicamente los lugares de los usuarios y el orden y paga con su tarjeta de crdito en su discurso al recibir la orden.', 0);;
INSERT INTO w_lang_admin VALUES (1599, 'BUSINESS_PAYPAL_DELIVERY', true, NULL, 'Activating this payment gateway, the money will go 100% to the owner of the Paypal account configured. This method is really easy to setup, just add the business paypal email address to receive the payment and you are done, if the site owner wants to receive all the payments and then pay to the business owner that can also be done.', 'Die Aktivierung dieser Zahlungs-Gateway, wird das Geld zu 100% an den Besitzer des Paypal-Konto konfiguriert gehen. Diese Methode ist sehr einfach zu installieren, fgen Sie einfach die Geschfts paypal E-Mail-Adresse, um die Zahlung zu empfangen und Sie sind fertig, wenn der Inhaber der Website will alle Zahlungen zu erhalten und dann zu zahlen, um die Unternehmer, die auch getan werden kann.', 'La activacin de esta pasarela de pago, el dinero se destinar el 100% para el dueo de la cuenta de Paypal configurado. Este mtodo es muy fcil de instalar, slo tiene que aadir la direccin de correo electrnico de negocios de PayPal para recibir el pago y ya est, si el propietario del sitio quiere recibir todos los pagos y luego pagar al propietario de la empresa, que tambin se puede hacer.', 0);;
