INSERT INTO w_lang_admin VALUES (1600, 'BUSINESS_PAYPAL_ADAPTIVE_DELIVERY', true, NULL, 'This payment method allows to automatically split the payment between the business and the website owner, based on certain commision for example, the initial configuration of this payment gateway is done on the website settings screen. For more information about this please check https://developer.paypal.com/docs/classic/adaptive-payments/integration-guide/APIntro/', 'Diese Zahlungsmethode erlaubt es, automatisch die Zahlung aufgeteilt zwischen dem Unternehmen und dem Inhaber der Website, auf der Grundlage bestimmter Provision wird zum Beispiel die Anfangskonfiguration des Payment-Gateway auf der Website Einstellungen Screen. Fr weitere Informationen ber diese bitte https://developer.paypal.com/docs/classic/adaptive-payments/integration-guide/APIntro/', 'Este mtodo de pago permite dividir automticamente el pago entre el negocio y el propietario del sitio web, basado en cierta comisin por ejemplo, la configuracin inicial de esta pasarela de pago se realiza en la pantalla de configuracin del sitio web. Para obtener ms informacin sobre esto, por favor verifique https://developer.paypal.com/docs/classic/adaptive-payments/integration-guide/APIntro/', 0);;
INSERT INTO w_lang_admin VALUES (1628, 'EMAIL_TEMPLATE_REVIEW_NOW', true, NULL, 'Review Now', 'Jetzt berprfen', 'Revise Ahora', 0);;
INSERT INTO w_lang_admin VALUES (1601, 'BUSINESS_MERCADO_PAGO_DELIVERY', true, NULL, 'The user is allowed to pay with his credit card, just create an mercadopago.com account and setup the details. This payment gateway is allowed on Latin America', 'Der Benutzer kann mit seiner Kreditkarte zu bezahlen, nur eine mercadopago.com Konto und das Setup die Details zu schaffen. Das Payment-Gateway auf Lateinamerika erlaubt', 'El usuario se le permite pagar con su tarjeta de crdito, basta con crear una cuenta mercadopago.com y configurar los detalles. Se deja que esta pasarela de pago en Amrica Latina', 0);;
