INSERT INTO w_lang_admin VALUES (1602, 'BUSINESS_MERCURY_DELIVERY', true, NULL, 'The user is allowed to pay directly on your site with his credit card, just create an http://www.mercurypay.com/ account and setup the details. An SSL may be required, to install the SSL please purchase it (we recommend godaddy) and contact us, we will install it on your site. This payment gateway is allowed on the US.', 'Der Benutzer kann direkt auf Ihrer Website mit seiner Kreditkarte zu bezahlen, nur eine http://www.mercurypay.com/ Konto und das Setup die Details zu schaffen. Ein SSL erforderlich sein, die Installation des SSL kaufen Sie bitte (wir empfehlen godaddy) und kontaktieren Sie uns, wir werden es auf Ihrer Website zu installieren. Das Payment-Gateway basiert auf dem US erlaubt.', 'El usuario est autorizado a pagar directamente en su sitio con su tarjeta de crdito, basta con crear una cuenta http://www.mercurypay.com/ y la configuracin de los detalles. Un SSL puede ser necesario, para instalar el SSL favor comprarlo (recomendamos godaddy) y pngase en contacto con nosotros, vamos a instalarlo en su sitio. Se deja que esta entrada del pago en los EE.UU..', 0);;
INSERT INTO w_lang_admin VALUES (1669, 'ORDER_EMAIL_TEMPLATE_PAID_VIA_CASH', true, NULL, 'Paid via Cash', 'Via Barzahlung', 'Pagado a travs de Efectivo', 0);;
INSERT INTO w_lang_admin VALUES (1603, 'BUSINESS_WORLDPAY_DELIVERY', true, NULL, 'The user is allowed to pay directly on your site with his credit card, just create an http://www.worldpay.com/ account and setup the details. An SSL may be required, to install the SSL please purchase it (we recommend godaddy) and contact us, we will install it on your site. This payment gateway is allowed mainly on the UK for more info visit their site.', 'Der Benutzer kann direkt auf Ihrer Website mit seiner Kreditkarte zu bezahlen, nur eine http://www.worldpay.com/ Konto und das Setup die Details zu schaffen. Ein SSL erforderlich sein, die Installation des SSL kaufen Sie bitte (wir empfehlen godaddy) und kontaktieren Sie uns, wir werden es auf Ihrer Website zu installieren. Das Payment-Gateway ist vor allem auf das Vereinigte Knigreich fr weitere Informationen besuchen Sie die Website erlaubt.', 'El usuario est autorizado a pagar directamente en su sitio con su tarjeta de crdito, basta con crear una cuenta http://www.worldpay.com/ y la configuracin de los detalles. Un SSL puede ser necesario, para instalar el SSL favor comprarlo (recomendamos godaddy) y pngase en contacto con nosotros, vamos a instalarlo en su sitio. Esta pasarela de pago est permitido principalmente en el Reino Unido para obtener ms informacin visite su sitio.', 0);;
