INSERT INTO w_lang_admin VALUES (1976, 'BUSINESS_PAYU_DELIVERY', true, NULL, 'The user is allowed to pay directly on your site with his credit card, just create an http://www.payumoney.com/ account and setup the details. An SSL may be required, to install the SSL please purchase it (we recommend godaddy) and contact us, we will install it on your site. This payment gateway is allowed mainly on United States and United Kingdom.', 'Der Benutzer darf direkt auf Ihrer Website mit seiner Kreditkarte zu bezahlen, nur eine http://www.payumoney.com/ Konto und Setup-Details erstellen. Ein SSL erforderlich sein, die Installation des SSL kaufen Sie es bitte (wir empfehlen godaddy) und kontaktieren Sie uns, wir werden es auf Ihrer Website zu installieren. Das Payment-Gateway basiert hauptschlich auf USA und Grobritannien erlaubt.', 'El usuario est autorizado a pagar directamente en su sitio con su tarjeta de crdito, basta con crear una cuenta http://www.payumoney.com/ y la configuracin de los detalles. Un SSL puede ser necesario, para instalar el SSL favor comprarlo (recomendamos GoDaddy) y pngase en contacto con nosotros, vamos a instalarlo en su sitio. Esta pasarela de pago est permitido principalmente en Estados Unidos y Reino Unido.', 0);;
